import React from 'react';

function Login () {
    return (
        < div className="popup popup_open popup__auth  popup_overlay">
        <div className="popup__content">
            <form className="popup__form popup__form_auth" >
                <h2 className="popup__title popup__title_auth">dfdfdfd</h2>
                <div className="popup__set">
                    <div className="popup__input-conainer">

                    </div>
                    <button className="popup__button" type="submit" >Сохранить</button>
                </div>
            </form>
        </div>
    </div >
    )
}

export default Login;
